About Game:
The royal wedding and the fate of Europe are put at stake when an engagement ring with a rare diamond is stolen from the princess's compartment. Take on the role of a seasoned detective and solve this daring crime in a fascinating hidden object adventure game. Princess Sophia and her retinue were returning to their country after the engagement ceremony when the diamond ring disappeared from her compartment. You are summoned to the scene of the crime to find the ring and capture the thief. Explore smoothly drawn hidden object locations, solve mesmerizing puzzles and complete original mini-games to crack the case and save the wedding of the century.

